const e=JSON.parse('{"key":"v-412000bc","path":"/code/2020-04-09-Best-Time-to-Buy-and-Sell-Stock-II.html","title":"Best Time to Buy and Sell Stock II","lang":"zh-CN","frontmatter":{"title":"Best Time to Buy and Sell Stock II","description":"Say you have an array prices for which the ith element is the price of a given stock on day i.","tag":["TIQ"],"date":"2020-04-09T00:00:00.000Z","article":false,"category":"algorithms","head":[["meta",{"property":"og:url","content":"https://yinheng.me/code/2020-04-09-Best-Time-to-Buy-and-Sell-Stock-II.html"}],["meta",{"property":"og:site_name","content":"Best Intention"}],["meta",{"property":"og:title","content":"Best Time to Buy and Sell Stock II"}],["meta",{"property":"og:description","content":"Say you have an array prices for which the ith element is the price of a given stock on day i."}],["meta",{"property":"og:type","content":"website"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-06-26T04:24:55.000Z"}],["meta",{"property":"article:author","content":"Maple Yin"}],["meta",{"property":"article:tag","content":"TIQ"}],["meta",{"property":"article:published_time","content":"2020-04-09T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2023-06-26T04:24:55.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"WebPage\\",\\"name\\":\\"Best Time to Buy and Sell Stock II\\",\\"description\\":\\"Say you have an array prices for which the ith element is the price of a given stock on day i.\\"}"]]},"headers":[],"git":{"createdTime":1687753495000,"updatedTime":1687753495000,"contributors":[{"name":"Yin Heng","email":"yinheng@kuaishou.com","commits":1}]},"readingTime":{"minutes":1.08,"words":325},"filePathRelative":"code/2020-04-09-Best-Time-to-Buy-and-Sell-Stock-II.md","localizedDate":"2020年4月9日","excerpt":"<blockquote>\\n<p>Say you have an array <code>prices</code> for which the <em>i</em>th element is the price of a given stock on day <em>i</em>.</p>\\n<p>Design an algorithm to find the maximum profit. You may complete as many transactions as you like (i.e., buy one and sell one share of the stock multiple times).</p>\\n<p><strong>Note:</strong> You may not engage in multiple transactions at the same time (i.e., you must sell the stock before you buy again).</p>\\n<p><strong>Example 1:</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>Input: [7,1,5,3,6,4]\\nOutput: 7\\nExplanation: Buy on day 2 (price = 1) and sell on day 3 (price = 5), profit = 5-1 = 4.\\n            Then buy on day 4 (price = 3) and sell on day 5 (price = 6), profit = 6-3 = 3.\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>Example 2:</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>Input: [1,2,3,4,5]\\nOutput: 4\\nExplanation: Buy on day 1 (price = 1) and sell on day 5 (price = 5), profit = 5-1 = 4.\\n            Note that you cannot buy on day 1, buy on day 2 and sell them later, as you are\\n            engaging multiple transactions at the same time. You must sell before buying again.\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>Example 3:</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>Input: [7,6,4,3,1]\\nOutput: 0\\nExplanation: In this case, no transaction is done, i.e. max profit = 0.\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>Constraints:</strong></p>\\n<ul>\\n<li><code>1 &lt;= prices.length &lt;= 3 * 10 ^ 4</code></li>\\n<li><code>0 &lt;= prices[i] &lt;= 10 ^ 4</code></li>\\n</ul>\\n</blockquote>"}');export{e as data};
